import React, { useState } from 'react';
import './App.css';

const API = "https://apis.ccbp.in/list-creation/lists";

const fetchUsers = async (url) => {
  try {
    const response = await fetch(url);
    if (!response.ok) throw new Error('Failed to fetch data');
    const data = await response.json();
    return data.lists;
  } catch (err) {
    throw err;
  }
};

function App() {
  const [data, setData] = useState([]);
  const [list1, setList1] = useState([]);
  const [list2, setList2] = useState([]);
  const [middleList, setMiddleList] = useState([]);
  const [backupList1, setBackupList1] = useState([]);
  const [backupList2, setBackupList2] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(false);
  const [isListCreated, setIsListCreated] = useState(false);
  const [selectedLists, setSelectedLists] = useState({ list1: false, list2: false });
  const [view, setView] = useState('AllLists'); // Tracks the current view

  const loadData = async () => {
    setLoading(true);
    setError(false);
    try {
      const fetchedData = await fetchUsers(API);
      setData(fetchedData);
      const initialList1 = fetchedData.filter(item => item.list_number === 1);
      const initialList2 = fetchedData.filter(item => item.list_number === 2);
      setList1(initialList1);
      setList2(initialList2);
      setBackupList1(initialList1);
      setBackupList2(initialList2);
    } catch {
      setError(true);
    } finally {
      setLoading(false);
    }
  };

  React.useEffect(() => {
    loadData();
  }, []);

  const handleCheckboxChange = (listNumber) => {
    setSelectedLists((prevState) => ({
      ...prevState,
      [`list${listNumber}`]: !prevState[`list${listNumber}`],
    }));
  };

  const handleCreateList = () => {
    if (selectedLists.list1 && selectedLists.list2) {
      setIsListCreated(true);
    } else {
      alert('Please select both List 1 and List 2.');
    }
  };

  const moveItemToMiddleList = (item, fromList) => {
    if (fromList === 'list1') {
      setList1(list1.filter((i) => i.id !== item.id));
    } else {
      setList2(list2.filter((i) => i.id !== item.id));
    }
    setMiddleList([...middleList, item]);
  };

  const moveItemBackToList = (item, toList) => {
    setMiddleList(middleList.filter((i) => i.id !== item.id));
    if (toList === 'list1') {
      setList1([...list1, item]);
    } else {
      setList2([...list2, item]);
    }
  };

  const handleCancel = () => {
    setList1(backupList1);
    setList2(backupList2);
    setMiddleList([]);
    setIsListCreated(false);
    setSelectedLists({ list1: false, list2: false });
    setView('AllLists');
  };

  const handleUpdate = () => {
    setBackupList1(list1);
    setBackupList2(list2);
    setView('AllLists');
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return (
      <div className="failure-view">
        <h1>Something went wrong!</h1>
        <p>We couldn't fetch the data. Please try again later.</p>
        <button className="retry-button" onClick={loadData}>
          Retry
        </button>
      </div>
    );
  }

  if (view === 'AllLists') {
    return (
      <div>
        <h1 className="header">All Lists</h1>
        <div className="lists-container">
          <div className="list-container">
            <h2>List 1</h2>
            <div className="scrollable-list">
              <ul>
                {backupList1.map((item) => (
                  <li key={item.id}>
                    <h3>{item.name}</h3>
                    <p>{item.description}</p>
                  </li>
                ))}
              </ul>
            </div>
          </div>
          <div className="list-container">
            <h2>List 2</h2>
            <div className="scrollable-list">
              <ul>
                {backupList2.map((item) => (
                  <li key={item.id}>
                    <h3>{item.name}</h3>
                    <p>{item.description}</p>
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </div>
        <div className="create-list-button-container">
          <button
            className="create-list-button"
            onClick={() => setView('ListCreation')}
          >
            Create New List
          </button>
        </div>
      </div>
    );
  }

  return (
    <div>
      <h1 className="header">List Creation</h1>
      <div className="create-list-button-container">
        <button className="create-list-button" onClick={handleCreateList}>
          Create List
        </button>
      </div>
      <div className="lists-container">
        <div className="list-container">
          <label>
            <input
              type="checkbox"
              checked={selectedLists.list1}
              onChange={() => handleCheckboxChange(1)}
            />
            <span>List 1</span>
          </label>
          <div className="scrollable-list">
            <ul>
              {list1.map((item) => (
                <li key={item.id} onClick={() => moveItemToMiddleList(item, 'list1')}>
                  <h3>{item.name}</h3>
                  <p>{item.description}</p>
                </li>
              ))}
            </ul>
          </div>
        </div>

        {isListCreated && (
          <div className="list-container">
            <h2>Middle List</h2>
            <div className="scrollable-list">
              <ul>
                {middleList.map((item) => (
                  <li key={item.id} onClick={() => moveItemBackToList(item, item.list_number === 1 ? 'list1' : 'list2')}>
                    <h3>{item.name}</h3>
                    <p>{item.description}</p>
                  </li>
                ))}
              </ul>
            </div>
          </div>
        )}

        <div className="list-container">
          <label>
            <input
              type="checkbox"
              checked={selectedLists.list2}
              onChange={() => handleCheckboxChange(2)}
            />
            <span>List 2</span>
          </label>
          <div className="scrollable-list">
            <ul>
              {list2.map((item) => (
                <li key={item.id} onClick={() => moveItemToMiddleList(item, 'list2')}>
                  <h3>{item.name}</h3>
                  <p>{item.description}</p>
                </li>
              ))}
            </ul>
          </div>
        </div>
      </div>
      <div className="buttons-container">
        <button className="cancel-button" onClick={handleCancel}>
          Cancel
        </button>
        <button className="update-button" onClick={handleUpdate}>
          Update
        </button>
      </div>
    </div>
  );
}

export default App;
